<!DOCTYPE html>
<html lang="">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width,initial-scale=1.0">
    <link rel="icon" href="<%= BASE_URL %>favicon.ico">
    <title><%= htmlWebpackPlugin.options.title %></title>
        <!-- Bootstrap CSS -->
        
        
        <link
        href="https://cdn.jsdelivr.net/npm/bootstrap@4.6.2/dist/css/bootstrap.min.css"
        rel="stylesheet"
        integrity="sha384-H+K7U5CnXl1h5ywQ6tv3lF6yQoXc+30Kq+B6EfsrJk5YDiqI65hMdU8!rQ78vV1P"
        crossorigin="anonymous"
      >
  </head>

  <body>
    
    <noscript>
      <strong>We're sorry but <%= htmlWebpackPlugin.options.title %> doesn't work properly without JavaScript enabled. Please enable it to continue.</strong>
    </noscript>

        <!-- Popper.js (required for some Bootstrap components) -->
      <script
        src="https://cdn.jsdelivr.net/npm/@popperjs/core@2.11.8/dist/umd/popper.min.js"
        integrity="sha384-ksm0CGfzZgCkGR04UMGiZF9E3PbkiRx4Qf5gn0Ui6Q9Yo5iZXUanN6UbltvsP/5F"
        crossorigin="anonymous"
      ></script>

          <!-- Bootstrap JS -->
        <script
          src="https://cdn.jsdelivr.net/npm/bootstrap@4.6.2/dist/js/bootstrap.bundle.min.js"
          integrity="sha384-IUeMFfSNZEFgN6N8EKGhg17IVnp93UMqPn1/8SNRY8b4EY65v4QVo9Zv4W9S8G6j"
          crossorigin="anonymous"
        ></script>

    <div id="app"></div>
    <!-- built files will be auto injected -->
  </body>
</html>
